      content: >-
        Thank you for choosing our GDCS package!

        At cybersun, we take pride in our cutting-edge military and industrial technology, and greatly appreciate  your contribution to our establishment!

        Our Gas Distribution Control System ("GDCS"), is a system used to manually distribute various gasses throughout the workspace at your own discretion! Use cases range from getting rid of cockroach infestations with a quick pump of dichlorvos to relaxing your coworkers with a delightful aromatic mist, coming straight from your vents!

        The package includes:

        [bullet/] A full air injector assembly and installation around the site.

        [bullet/] An additional State of the art air cooling system installation.

        [bullet/] Two free canisters of nitrous oxide and plasma for easy start.

        How to use:

        1. Make sure to connect any gasses you want to distribute to either port A or Port B, as well as an empty waste canister to the port C.

        2. Configure the mixers, filters and gas pumps to your desired parameters before turning them on.

        3. Enjoy! you may now release the gasses from any connected air injector with the help of our GDCS controller built into the floor of the control room, just make sure to turn the switches off once you've pumped enough.
